-- title:  game title
-- author: game developer
-- desc:   short description
-- script: lua

stat={title=0,game=1}
gstat=stat.title

function TIC()
	if gstat == stat.title then
		stat_title()
	elseif gstat == stat.game then
	 stat_game()
	end
end

function stat_title()
	cls(4)
	spr(10,0,0,0,2,0,0)
	spr(10,240-16,0,0,2,1,0)
	spr(10,0,136-16,0,2,2,0)
	spr(10,240-16,136-16,0,2,3,0)
	for i=0,12 do
		spr(11,(i+1)*16,0,0,2,0,0)
		spr(11,(i+1)*16,136-16,0,2,2,0)
	end
	for i=0,5 do
		spr(11,0,(i+1)*16,0,2,0,3)
		spr(11,240-16,(i+1)*16,0,2,1,3)
	end
	spr(11,0,104,0,2,0,3)
	spr(11,240-16,104,0,2,1,3)
	
	spr(0,24,40,0,2,0,0,2,2)
	spr(2,64,40,0,2,0,0,2,2)
	spr(4,104,40,0,2,0,0,2,2)
	spr(6,144,40,0,2,0,0,2,2)
	spr(8,184,40,0,2,0,0,2,2)
	
	print("Press A to start", 70,110,2)
	
 if btnp(4,60,6) then
		gstat=1
		trace("exit title")
	end
end

function stat_game()
 cls(4)
	
	--
end

